import React from 'react';
import BotCard from './BotCard';

const BotArmy = ({ enlistedBots, onReleaseBot, onDischargeBot }) => {
  return (
    <div className="bot-army-container">
      <div className="your-bot-army">
        <h2>Your Bot Army</h2>
        {enlistedBots.map((bot) => (
          <BotCard key={bot.id} bot={bot}>
            <button onClick={() => onReleaseBot(bot)}>Release Bot</button>
            <button onClick={() => onDischargeBot(bot.id)}>Discharge Bot</button>
          </BotCard>
        ))}
      </div>
    </div>
  );
};

export default YourBotArmy;
